pub enum VMError {
    FunctionCallError(FunctionCallError),

    /// Serialized external error from External trait implementation.
    ExternalError(Vec<u8>),

    /// An error that is caused by an operation on an inconsistent state.
    /// E.g. an integer overflow by using a value from the given context.
    InconsistentStateError(InconsistentStateError),
}

pub enum FunctionCallError {

    /// Wasm compilation error
    CompilationError(CompilationError),

    /// Wasm binary env link error
    LinkError {
        msg: String,
    },

    /// Import/export resolve error
    MethodResolveError(MethodResolveError),

    /// A trap happened during execution of a binary
    WasmTrap(WasmTrap),
    WasmUnknownError,
    HostError(HostError),
}

pub enum WasmTrap {

    /// An `unreachable` opcode was executed.
    Unreachable,

    /// Call indirect incorrect signature trap.
    IncorrectCallIndirectSignature,

    /// Memory out of bounds trap.
    MemoryOutOfBounds,

    /// Call indirect out of bounds trap.
    CallIndirectOOB,

    /// An arithmetic exception, e.g. divided by zero.
    IllegalArithmetic,

    /// Misaligned atomic access trap.
    MisalignedAtomicAccess,

    /// Breakpoint trap.
    BreakpointTrap,

    /// Stack overflow.
    StackOverflow,

    /// Generic trap.
    GenericTrap,
}

pub enum MethodResolveError {
    MethodEmptyName,
    MethodUTF8Error,
    MethodNotFound,
    MethodInvalidSignature,
}

pub enum CompilationError {
    CodeDoesNotExist {
        account_id: String,
    },
    PrepareError(PrepareError),
    WasmerCompileError {
        msg: String,
    },
}

pub enum PrepareError {

    /// Error happened while serializing the module.
    Serialization,

    /// Error happened while deserializing the module.
    Deserialization,

    /// Internal memory declaration has been found in the module.
    InternalMemoryDeclared,

    /// Gas instrumentation failed.
    ///
    /// This most likely indicates the module isn't valid.
    GasInstrumentation,

    /// Stack instrumentation failed.
    ///
    /// This  most likely indicates the module isn't valid.
    StackHeightInstrumentation,

    /// Error happened during instantiation.
    ///
    /// This might indicate that `start` function trapped, or module isn't
    /// instantiable and/or unlinkable.
    Instantiate,

    /// Error creating memory.
    Memory,
}

pub enum HostError {

    /// String encoding is bad UTF-16 sequence
    BadUTF16,

    /// String encoding is bad UTF-8 sequence
    BadUTF8,

    /// Exceeded the prepaid gas
    GasExceeded,

    /// Exceeded the maximum amount of gas allowed to burn per contract
    GasLimitExceeded,

    /// Exceeded the account balance
    BalanceExceeded,

    /// Tried to call an empty method name
    EmptyMethodName,

    /// Smart contract panicked
    GuestPanic {
        panic_msg: String,
    },

    /// IntegerOverflow happened during a contract execution
    IntegerOverflow,

    /// `promise_idx` does not correspond to existing promises
    InvalidPromiseIndex {
        promise_idx: u64,
    },

    /// Actions can only be appended to non-joint promise.
    CannotAppendActionToJointPromise,

    /// Returning joint promise is currently prohibited
    CannotReturnJointPromise,

    /// Accessed invalid promise result index
    InvalidPromiseResultIndex {
        result_idx: u64,
    },

    /// Accessed invalid register id
    InvalidRegisterId {
        register_id: u64,
    },

    /// Iterator `iterator_index` was invalidated after its creation by performing a mutable operation on trie
    IteratorWasInvalidated {
        iterator_index: u64,
    },

    /// Accessed memory outside the bounds
    MemoryAccessViolation,

    /// VM Logic returned an invalid receipt index
    InvalidReceiptIndex {
        receipt_index: u64,
    },

    /// Iterator index `iterator_index` does not exist
    InvalidIteratorIndex {
        iterator_index: u64,
    },

    /// VM Logic returned an invalid account id
    InvalidAccountId,

    /// VM Logic returned an invalid method name
    InvalidMethodName,

    /// VM Logic provided an invalid public key
    InvalidPublicKey,

    /// `method_name` is not allowed in view calls
    ProhibitedInView {
        method_name: String,
    },

    /// The total number of logs will exceed the limit.
    NumberOfLogsExceeded {
        limit: u64,
    },

    /// The storage key length exceeded the limit.
    KeyLengthExceeded {
        length: u64,
        limit: u64,
    },

    /// The storage value length exceeded the limit.
    ValueLengthExceeded {
        length: u64,
        limit: u64,
    },

    /// The total log length exceeded the limit.
    TotalLogLengthExceeded {
        length: u64,
        limit: u64,
    },

    /// The maximum number of promises within a FunctionCall exceeded the limit.
    NumberPromisesExceeded {
        number_of_promises: u64,
        limit: u64,
    },

    /// The maximum number of input data dependencies exceeded the limit.
    NumberInputDataDependenciesExceeded {
        number_of_input_data_dependencies: u64,
        limit: u64,
    },

    /// The returned value length exceeded the limit.
    ReturnedValueLengthExceeded {
        length: u64,
        limit: u64,
    },

    /// The contract size for DeployContract action exceeded the limit.
    ContractSizeExceeded {
        size: u64,
        limit: u64,
    },

    /// The host function was deprecated.
    Deprecated {
        method_name: String,
    },
}

pub enum VMLogicError {
    HostError(HostError),

    /// Serialized external error from External trait implementation.
    ExternalError(Vec<u8>),

    /// An error that is caused by an operation on an inconsistent state.
    InconsistentStateError(InconsistentStateError),
}

pub enum InconsistentStateError {

    /// Math operation with a value from the state resulted in a integer overflow.
    IntegerOverflow,
}
